import React from "react";
import { Html } from "drei";
import { Section } from "./section"

const HTMLContent = () => {
    return(
        <Section 
            factor={1.5} 
            offset={1} // props used for the scrolling effect 
        >
            <Html fullscreen>
                <div className="container">
                <h1 className="title"> Hello </h1>
                </div>
            </Html>
        </Section>
    )
}

export default HTMLContent
